    </span></div><span data-v-0cd3bce1> Powered by Gridsome &amp; Markdown </span></footer></div> <script>window.__INITIAL_STATE__={"data":{"tag":{"title":"Laravel","belongsTo":{"edges":[{"node":{"title":"Add another version of PHP in Laragon","path":"\u002Fpost\u002Fadd-another-version-of-php-in-laragon\u002F","date":"24. September 2020","timeToRead":1,"description":"","content":"\u003Cp\u003EThe Laravel team recently announced a new scaffolding application for Laravel 8 called Laravel Jetstream.\nIt scaffolds a working Laravel app with login, registration, email verification, two-factor authentication, session management, and even optional team management.\u003C\u002Fp\u003E\n\u003Cp\u003EI installed Jetstream using the Laragon setup. However, it fails to create a Laravel app due to the PHP version mismatch pre-installed on Laragon by default. For Laravel Jetstream to work, PHP 7.4 or higher must be installed on the developer machine.\u003C\u002Fp\u003E\n\u003Cp\u003EThe quick solution to this is, of course, to add a specific version of PHP on Laragon.\u003C\u002Fp\u003E\n\u003Cp\u003ESo how do you add a new version of PHP in Laragon? It is easy and straight to the point.\u003C\u002Fp\u003E\n\u003Ch2 id=\"steps-to-follow\"\u003E\u003Ca href=\"#steps-to-follow\" aria-hidden=\"true\"\u003E\u003Cspan class=\"icon icon-link\"\u003E\u003C\u002Fspan\u003E\u003C\u002Fa\u003ESteps to follow\u003C\u002Fh2\u003E\n\u003Col\u003E\n\u003Cli\u003EDownload PHP version 7.4 zip file on PHP download \u003Ca href=\"https:\u002F\u002Fwindows.php.net\u002Fdownload\" target=\"_blank\" rel=\"nofollow noopener noreferrer\"\u003Epage\u003C\u002Fa\u003E.\u003C\u002Fli\u003E\n\u003Cli\u003EExtract the zip file and put inside the root laragon installation folder \u003E bin \u003E PHP. I'm using Windows OS, in my case, it is in:\u003C\u002Fli\u003E\n\u003C\u002Fol\u003E\n\u003Cpre class=\"language-text\"\u003E\u003Ccode class=\"language-text\"\u003EC:&gt;laragon&gt;bin&gt;php\u003C\u002Fcode\
